INSERT INTO public.pregunta VALUES (21, 'Las abejas son atraídas por la forma, color y aroma de las flores. Sobre todo prefieren las de _ amarillos y azules, con aromas _ y cantidades moderadas de néctar con el que se fabricará la _ que comemos las personas. El _ se produce en glándulas denominadas _, que se sitúan en el _ de las flores. Así, para _ o libar el néctar, la _ debe avanzar un trayecto más o menos largo durante el cual _ y dorso tocan distintas partes de la flor, entre ellas los _ impregnándose de polen.', 5, 2, NULL, NULL, NULL, NULL, 'Un beneficio mutuo
Texto tomado de internet: http://www.faunatura.com/lenguaje-abejas.html (consultado el día 13
de mayo, 2017).
Complete los espacios en blanco que aparecen en el texto. Para ello seleccione diez (10) palabras
de la lista que sigue. Tenga en cuenta que no puede repetir ninguna, y que sobran cuatro.

-----------------------------------------------------------------------------------------------------------
Conjunto de palabras para elegir: (pétalos) (abeja) (tonos) (chupar) (miel) (frescos) (flor)
(cabeza) (nectarios) (néctar) (lamer) (interior) (estambres) (tallos)', true, true, true, false, false);
