INSERT INTO public.pregunta VALUES (11, '1.- De acuerdo a lo expuesto en el texto, es correcto afirmar que la hipótesis que da origen a la
investigación presupone la existencia de una correlación entre:', 5, 2, NULL, NULL, NULL, NULL, 'Relación del estilo de vida y estado de nutrición en estudiantes universitarios: estudio
descriptivo de corte transversal
Autores: Diana Córdoba Adaya, Maricela Carmona González, Omar Ernesto Terán Varela, Ofelia
Márquez Molina, Medwave 2013; 13(11):e5864 doi:10.5867/medwave.2013.11.5864).
Resumen
Introducción: el estilo de vida es el conjunto de comportamientos que practica habitualmente una
persona en forma consciente y voluntaria durante el transcurso de su vida. La evaluación del
estado nutricional a través de la antropometría permite tomar medidas preventivas en beneficio
de la salud. Ello cobra importancia en los jóvenes, pues diversos autores han destacado que la
población universitaria es un grupo especialmente vulnerable para desarrollar costumbres y
hábitos de riesgo. Propósito: el objetivo de la investigación es evaluar y relacionar el estilo de vida
con el estado de nutrición de los estudiantes universitarios. Diseño: estudio observacional,
descriptivo, de corte transversal. Se valoró el estado de nutrición y se aplicó el cuestionario
FANTASTIC. Resultados: el 88.1% de los estudiantes tienen un estilo de vida saludable y 65% fue
clasificado como normal de acuerdo al índice de masa corporal. Conclusión: se encontró que sí
existe una relación entre el estilo de vida y el estado de nutrición. Por otro lado, se identificaron
conductas de riesgo en las dimensiones de nutrición, tabaco, sueño y estrés.', true, true, false, false, true);
INSERT INTO public.pregunta VALUES (15, '___', 5, 2, NULL, NULL, NULL, NULL, 'Lea el texto que sigue a continuación y seleccione tres conjuntos de palabras que definan el
carácter descriptivo de la muestra (por ejemplo: estrato social).
Los sujetos fueron seleccionados de una muestra chilena de ambos sexos e igual tamaño
representando el mismo grupo etario del país.', true, true, true, false, false);
INSERT INTO public.pregunta VALUES (17, '2.- ¿Por qué la autora afirma que resulta fingida la polémica por la letra de la canción “Cuatro
babys”, de Maluma?', 5, 2, NULL, NULL, NULL, NULL, 'Reguetón, la música de la realidad.
Sánchez, Y. (2016). Reguetón, la música de la realidad. El País, España, 27 Diciembre
El vehículo está a punto de desarmarse en cada bache de las deterioradas calles habaneras. Los
pasajeros del taxi colectivo vibran con el traqueteo de la estructura y un reguetón que suena en el
reproductor. Es la banda sonora de este principio de siglo, un género de letras crudas y sexualidad
explícita que acompaña cada minuto de la realidad.
Con una paternidad compartida entre Puerto Rico y Panamá, este sonido urbano marca el
nacimiento del milenio. Le ha agregado a los tiempos que vivimos un toque descarnado y cierto
ritmo de lascivia. En las letras de sus canciones se venera la aparatosidad como si fuera una virtud.
Ensalzan un mundo donde el tamaño del reloj y el grueso de la cadena de oro cada vez importan
más. Los cantantes de esta música feroz no quieren ser vistos como héroes ni como enamorados
de corazón roto. Más bien desean transmitir una imagen de cínica supervivencia, de calculada
liviandad.
De ahí la polvareda que levantó en algunos la impúdica letra de Cuatro babys, la canción del
intérprete colombiano Maluma en la que fanfarronea por disponer a su antojo de cuatro mujeres.
La repulsa que ha recibido el tema se disuelve en los 200 millones de reproducciones que exhibe el
videoclip en YouTube. Son tiempos de hits (…) no de indignación.
Las aseveraciones de Maluma no escandalizan a los seguidores del ritmo, más bien lo ven como el
cronista de una realidad tangible y conocida. No es el reguetón, es la vida la que no ha cuajado
como debería. El colombiano solo es el altavoz de un mensaje tan preocupante pero cotidiano que
no despeina ni una sola ceja por estos lares. Los sonrojos no cambian el entorno.
El reguetón se ha convertido en una manera de mirar la vida, en una cosmogonía sin delicadezas ni
medias tintas. No importa si se sigue o no, si gusta o no, no hay manera de taparse los oídos y
obviarlo. Está aquí, por todos lados. Nuestros hijos tararean sus estribillos.
Tanto es así que hablar y comprender los códigos del reguetón resulta indispensable para
comunicar con la generación más joven, pero también con muchos de sus padres. Minimizarlo y
censurarlo solo lo potencia, porque se ha vuelto el compás que expresa la rebeldía. Ha durado más
que cualquier otro género aupado por las casas discográficas o las políticas culturales.
A finales del siglo pasado muy pocos hubieran vaticinado que este ritmo urbano dominaría
durante varios lustros la música que se difunde en las discotecas, las fiestas privadas y los
reproductores a los que nos aferramos a través de un par de audífonos. Sin embargo, se quedó,
nos atrapó en su desmedida impudicia. Quizás solo interpretó lo que latía más abajo, lejos de las
luces de las ceremonias, los trajes para la ocasión y el oportunismo.

Página 5 de 22
¿Quién lo hubiera dicho? De las canciones de Víctor Jara a las pegajosas frases de Don Omar, del
utópico Silvio Rodríguez a los descarnados músicos cubanos Yomil y El Dany. El unicornio azul
pasta ahora en una pradera de minúsculos biquinis y billetes de cien. Aquellos que tarareaban que
venían a “entregar su corazón” han decidido canjearlo por una piscina en la que retozan mil y una
ninfas que ni siquiera hablan.
Peleados muchas veces con el diccionario, la academia y tanto sabio de café con leche, los
reguetoneros son ídolos de adolescentes y dictan moda, costumbres y maneras de decir. No viajan
en submarinos amarillos, sino en autos de lujo, rodeados de alcohol y besos. Estos no son años de
sicodelia sino de aterrizar, cuanto más abajo se caiga y más profunda sea la zambullida en los
abismos de los excesos más discos venderán.
No por gusto, Barack Obama (…) durante su histórico discurso en La Habana hizo alusión al
contagioso ritmo cuando aseguró: “En Miami o en La Habana, se pueden encontrar sitios para
bailar el chachachá o la salsa y comer ropa vieja. La gente en ambos países ha cantado junto a
Celia Cruz o Gloria Estefan, y ahora escuchan reguetón o a Pitbull”.
El reguetón ha resultado ser el inesperado antídoto contra el malestar de la cultura diagnosticado
por Sigmund Freud. Representa, como pocos fenómenos, el fin de la inocencia. ¿Acaso quedaba
alguna? Un tirón animal que nos devuelve a ese estado del que tal vez nunca hemos salido, un
momento en que somos solo carne y vísceras.', true, true, false, false, true);
