INSERT INTO public.registrolog VALUES (63, '2018-12-03 07:23:14', 'pregunta', 1000, '', 'Modificación: Las abejas son atraídas por la forma, color y aroma de las flores. Sobre todo prefieren las de
__________________ amarillos y azules, con aromas __________________ y cantidades
moderadas de néctar con el que se fabricará la __________________ que comemos las personas.
El __________________ se produce en glándulas denominadas __________________, que se
sitúan en el __________________ de las flores. Así, para _________________ o libar el néctar, la
__________________ debe avanzar un trayecto más o menos largo durante el cual
