y NanBernsteinRatner, El desarrollo del lenguaje.Madrid: Pearson.
Lea el texto que se presenta a continuación y luego realice las siguientes actividades.
Se ha demostrado que algunos insectos, como las abejas, tienen elaborados sistemas de
comunicación. El etólogo Karl von Frisch (1950) empezó a estudiar las abejas en la década de los
años veinte y ganó el premio Nobel en 1973 por sus estudios de la comunicación entre estos
insectos tan sociales. A diferencia del maullar expresivo de un gato hambriento, en muchos
sentidos el sistema de comunicación de las abejas es referencial: comunica a otras abejas algo
sobre el mundo externo. Una abeja que regresa a la colmena tras haber encontrado flores llenas
de néctar agrupa una audiencia y a continuación realiza una danza que indica la dirección y la
distancia aproximada del néctar con respecto a la colmena. Otras abejas miran, se unen a la danza
y después se dirigen a las flores. La danza de la abeja es, de hecho, una forma miniaturizada del
trayecto hasta las flores más que una afirmación simbólica. No hay nada simbólico o arbitrario en
danzar hacia el norte para indicar que otras abejas deberían volar en esa dirección. Además,
aunque los movimientos de la danza tienen una estructura y un significado, solo hay un posible
tema de conversación: dónde encontrar el néctar. Incluso este repertorio está seriamente
limitado; por ejemplo, las abejas no pueden decirse unas a otras que las flores son bonitas o que
están hartas de ir en busca de néctar. -Activa de: false a: true ', 22);
