INSERT INTO public.registrolog VALUES (76, '2018-12-03 07:52:37', 'pregunta', 1000, '', 'Modificación: ¿Cuál de las siguientes afirmaciones corresponde a la idea principal del texto? -Enunciado de:  a: ¿Cuál de las siguientes afirmaciones corresponde a la idea principal del texto? -Privacidad de: false a: true -Explicación de:  a: Hacia la conquista de “la autonomía”
Meirieu, Ph. (1998). Frankenstein Educador. Barcelona: Ed. Laertes (Págs. 86 a 88)

Hay que desconfiar, sin duda alguna, de la noción de autonomía. Está demasiado de moda,
demasiado extendida, se la utiliza demasiado, para que de veras sea significativa. La autonomía
(…) nadie está en contra, y ese mismo hecho debería ponernos en guardia. El formar para la
autonomía se ensalza en todos los proyectos de enseñanza (…) sin que acabe de verse, la mayor
parte de las veces, en qué se encarna y cómo se concreta.
Y es que la cosa no es tan sencilla. Hablando en propiedad, nadie es nunca del todo autónomo: soy
autónomo financieramente, más o menos; pero en absoluto afectivamente, porque dependo en
enorme medida de mis relaciones con mi entorno y del afecto que se me tenga; si decido hacer
lampistería en mi cuarto de baño, no soy autónomo en absoluto, porque dependo en enorme
medida de la ayuda, los consejos y el respaldo de algún amigo que entienda de eso; en lo que hace
al cuidado de mi jardín o de mi salud, conviene que sepa exactamente hasta dónde puedo
arreglármelas solo y a partir de cuándo es imprescindible que recurra a un especialista y le ceda,
en esos ámbitos, mi autonomía (…). En realidad, un ser completamente autónomo sería, en
sentido estricto, un ser “suficiente”, es decir, un ser absolutamente insoportable para sus
semejantes; mientras que un ser completamente heterónomo, es decir, incapaz de bastarse a sí
mismo en nada, estaría en peligro constante de muerte psicológica o física. Si se quiere hablar de
autonomía sin condenarse a no decir nada, conviene, pues, precisar qué ámbito de autonomía se
quiere desarrollar, qué nivel de autonomía se pretende que alcance la gente en ese ámbito y de
qué medios se dispone para llegar a ello.
La definición del ámbito de autonomía remite a la especificidad de la institución en la que se está y
de las competencias particulares de los educadores que trabajan en ella: la enfermera tiene por
objetivo que las personas sean autónomas en la gestión de sus medicamentos usuales; la asistenta
social, que lo sean en la gestión del presupuesto familiar; (…). La escuela, por su parte, ha de tener
por objetivo la autonomía de los alumnos en la gestión de sus aprendizajes: en la gestión de los
métodos y los medios, del tiempo, del espacio y los recursos, de las interacciones sociales en la

Página 15 de 22
clase considerada como “colectividad de aprendedores”, de la construcción progresiva del “yo en
el mundo”.
En cuanto al nivel de autonomía, debe definirse a partir del nivel ya alcanzado por la persona; ha
de representar un nivel superior pero accesible, un escalón de desarrollo que manifieste un
progreso real… Intentar llevar a alguien a un nivel de autonomía muy superior a aquél en que está,
y hacerlo bruscamente, es, evidentemente, condenarse al fracaso/condenar al otro a una
regresión y, usualmente, preparar un retorno a una situación de coacción intensa que se
justificará… ¡alegando que “el otro, según ha quedado claro, no es autónomo en absoluto”!
(…)
Por último, para el desarrollo de la autonomía hay que disponer de medios específicos, de un
sistema de ayuda y guía que se irá aligerando progresivamente. -Activa de: false a: true ', 28);
INSERT INTO public.registrolog VALUES (77, '2018-12-03 07:52:37', 'pregunta', 1000, '', 'Modificación: Para el desarrollo de la autonomía es necesario: -Enunciado de:  a: Para el desarrollo de la autonomía es necesario: -Privacidad de: false a: true -Explicación de:  a: Hacia la conquista de “la autonomía”
